		def self.get_client_info(user)
			ethApiKey = user.ethApiKey
			ethAddresses = user.ethAddresses.join(',')
			if MOCK_DATA_FOR.include?(ENVIRONMENT)
				last_price = Marshal.load(Marshal.dump(MOCK_DATA[:last_price]))
				balance = Marshal.load(Marshal.dump(MOCK_DATA[:balance]))
			else
				balance_params = BALANCE_PARAMS
				balance_params[:address] = ethAddresses
				last_price = DataFactory.send_request(ETH_API_URL, '', LAST_PRICE_PARAMS, ethApiKey)
				balance = DataFactory.send_request(ETH_API_URL, '', balance_params, ethApiKey)
			end
			info = {
				last_price: last_price,
				balances: balance
			}
			return info 
		end
		def self.get_statements(address,ethApiKey,logger)
			if MOCK_DATA_FOR.include?(ENVIRONMENT)
				statements = Marshal.load(Marshal.dump(MOCK_DATA[:tx_list]))
				#logger.debug(statements)
			else
				params = TX_LIST_PARAMS.merge({address: address})
				logger.debug("getting from etherscan")
				statements = DataFactory.send_request(ETH_API_URL, '', params, ethApiKey)
			end
			return statements
		end
	end
